import React from "react";
import { connect } from "react-redux";
import { editCreator, deleteCreator } from "../redux/React-Form/form-action";

const StudentInfor = ({ listProduct, editCreator, deleteCreator }) => {
  return (
    <div>
      <table className="table mt-4">
        <thead className="thead-dark">
          <tr>
            <th scope="col">Mã SV</th>
            <th scope="col">Họ tên</th>
            <th scope="col">Số điện thoại</th>
            <th scope="col">Email</th>
          </tr>
        </thead>
        <tbody>
          {listProduct.map((p) => (
            <tr key={p.id}>
              <th scope="row">{p.id}</th>
              <td>{p.productId}</td>
              <td>${p.price}</td>
              <td>
                <img
                  alt=""
                  src={p.image}
                  style={{
                    width: 50,
                    height: 50,
                  }}
                />
              </td>
              <td>{p.productType}</td>
              <td>{p.productDesc}</td>
              <td>
                <button
                  onClick={() => {
                    editCreator(p);
                  }}
                >
                  Edit
                </button>
                <button
                  onClick={() => {
                    deleteCreator(p.id);
                  }}
                  className="mx-2"
                >
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default connect(null, { editCreator, deleteCreator })(StudentInfor);
